import StyleSheet from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 35,
  },
  inputGroup: {
    flex: 1,
    padding: 0,
    marginBottom: 15,
    borderBottomColor: '#cccccc',
    borderBottomWidth: 1,
  },
});

export default styles;
